const About_Team = () => {
  return (
    <section className="pagecenter padding">
      <h3 className="title text-center mb-10">
        <span className="halfbg-left">
          دانش آموختگان ما در این شرکت ها مشغول به کارند
        </span>
      </h3>
    </section>
  );
};

export default About_Team;
